import React, { useState, useEffect } from 'react';

function CompetitionTable({ 
  points,
  eventType, 
  onCalculatePerformance,
}) {
  const [baseMeet, setBaseMeet] = useState('');
  const [basePlace, setBasePlace] = useState('');
  const [basePoints, setBasePoints] = useState('');
  const [performances, setPerformances] = useState({});

  // Define the fixed competition level points
  const competitionPoints = {
    'OLYMPICS/WORLDS': {
      1: 375, 2: 330, 3: 300, 4: 270, 5: 250, 6: 230, 7: 215, 8: 200, 9: 130, 
      10: 120, 11: 110, 12: 100, 13: 95, 14: 90, 15: 85, 16: 80
    },
    'DIAMOND FINAL': {
      1: 240, 2: 210, 3: 185, 4: 170, 5: 155, 6: 145, 7: 135, 8: 125, 9: 90,
      10: 80, 11: 70, 12: 60
    },
    'DIAMOND LEAGUE': {
      1: 200, 2: 170, 3: 150, 4: 140, 5: 130, 6: 120, 7: 110, 8: 100, 9: 70,
      10: 60, 11: 50, 12: 45
    },
    'DIAMOND LEAGUE FINAL': {
      1: 170, 2: 145, 3: 130, 4: 120, 5: 110, 6: 100, 7: 90, 8: 80, 9: 60,
      10: 50, 11: 45, 12: 40
    },
    'CATEGORY A': {
      1: 140, 2: 120, 3: 110, 4: 100, 5: 90, 6: 80, 7: 70, 8: 60
    },
    'CATEGORY B': {
      1: 100, 2: 80, 3: 70, 4: 60, 5: 55, 6: 50, 7: 45, 8: 40
    },
    'CATEGORY C': {
      1: 60, 2: 50, 3: 45, 4: 40, 5: 35, 6: 30, 7: 27, 8: 25
    },
    'CATEGORY D': {
      1: 40, 2: 35, 3: 30, 4: 25, 5: 22, 6: 19, 7: 17, 8: 15
    },
    'CATEGORY E': {
      1: 25, 2: 21, 3: 18, 4: 15, 5: 12, 6: 10
    },
    'CATEGORY F': {
      1: 15, 2: 10, 3: 5
    }
  };

  const calculateEquivalentPerformances = async () => {
    if (!baseMeet || !basePlace) return;

    const totalPoints = (points || 0) + (competitionPoints[baseMeet][basePlace] || 0);

    try {
      const response = await fetch('http://localhost:5001/api/calculate-performance', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          points: totalPoints,
          event_type: eventType,
        }),
      });

      const data = await response.json();
      setPerformances(prevPerformances => ({
        ...prevPerformances,
        [eventType]: data.performance
      }));
    } catch (error) {
      console.error('Error:', error);
    }
  };

  useEffect(() => {
    if (points && eventType) {
      calculateEquivalentPerformances();
    }
  }, [points, eventType, baseMeet, basePlace]);

  return (
    <div className="competition-page">
      <div className="competition-main">
        <h2>Competition Level Comparison</h2>

        {/* First table - automatic sums */}
        <div className="base-points-section">
          <h3>Base Points</h3>
          <div className="points-display">
            {points || 'Enter points'}
            <span className="meet-level">No bonus</span>
          </div>
        </div>

        <h3>Total Points (Performance + Placement)</h3>
        <table className="competition-table">
          <thead>
            <tr>
              <th>PLACE</th>
              <th>OLYMPICS/WORLDS</th>
              <th>DIAMOND FINAL</th>
              <th>DIAMOND LEAGUE</th>
              <th>DIAMOND LEAGUE FINAL</th>
              <th>CATEGORY A</th>
              <th>CATEGORY B</th>
              <th>CATEGORY C</th>
              <th>CATEGORY D</th>
              <th>CATEGORY E</th>
              <th>CATEGORY F</th>
            </tr>
          </thead>
          <tbody>
            {[...Array(16)].map((_, index) => {
              const place = index + 1;
              return (
                <tr key={place}>
                  <td>{place}</td>
                  {Object.keys(competitionPoints).map(level => (
                    <td key={level}>
                      {competitionPoints[level][place] 
                        ? (points || 0) + competitionPoints[level][place]
                        : '-'}
                    </td>
                  ))}
                </tr>
              );
            })}
          </tbody>
        </table>

        {/* Second table - interactive */}
        <h3>Required Performances for Equivalent Points</h3>
        <div className="meet-selection">
          <select value={baseMeet} onChange={(e) => setBaseMeet(e.target.value)}>
            <option value="">Select Meet Level</option>
            {Object.keys(competitionPoints).map(level => (
              <option key={level} value={level}>{level}</option>
            ))}
          </select>
          <select value={basePlace} onChange={(e) => setBasePlace(e.target.value)}>
            <option value="">Select Place</option>
            {baseMeet && Object.keys(competitionPoints[baseMeet]).map(place => (
              <option key={place} value={place}>Place {place}</option>
            ))}
          </select>
          <input
            type="number"
            value={basePoints}
            onChange={(e) => setBasePoints(e.target.value)}
            placeholder="Enter base points"
          />
        </div>

        <table className="competition-table">
          <thead>
            <tr>
              <th>Event</th>
              <th>Required Performance</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(performances).map(([event, performance]) => (
              <tr key={event}>
                <td>{event}</td>
                <td>{performance}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default CompetitionTable;
